};

Jx().$package(function(J){
    // 按顺序执行 funcA, funcB, funcC，当中途有一个 func 的执行结果返回 true 则不再往下执行，并返回成功执行的 func 的返回值；
    J.$try(funcA, funcB, funcC);
};

Jx().$package(function(J){
    // 用 objB 和objC 扩展 objA 对象；
    J.extend(objA, objB, objC);
};

